    const navigate = useNavigate();
    const { isAuth, email } = useAuth();

    return isAuth ? (
        <div>
            <div>MyCabinetPage</div>
            <button >Log out from {email}</button>
        </div>
    ) : (
        // navigate('/cabinet')
        <span>Войдите</span>
    )
}
